// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";


contract PiggyBank is Ownable, ReentrancyGuard {

    uint256 public constant EARLY_WITHDRAWAL_FEE = 3; 
    uint256 public constant FEE_DENOMINATOR = 100;


    address public immutable factory;
    address public immutable tokenAddress;
    uint256 public immutable lockPeriod;
    uint256 public immutable createdAt;
    uint256 public balance;
    bool public isClosed;


    event Deposited(address indexed user, uint256 amount, uint256 timestamp);
    event Withdrawn(address indexed user, uint256 amount, uint256 timestamp);
    event EarlyWithdrawalFee(address indexed user, uint256 feeAmount, uint256 timestamp);
    event Closed(address indexed user, uint256 timestamp);


    constructor(
        address _owner,
        uint256 _lockPeriod,
        address _tokenAddress,
        address _factory
    ) Ownable(_owner) {
        require(_lockPeriod > 0, "Lock period must be greater than 0");
        require(_factory != address(0), "Factory address cannot be zero");

        factory = _factory;
        tokenAddress = _tokenAddress;
        lockPeriod = _lockPeriod;
        createdAt = block.timestamp;
    }


    function deposit(uint256 amount) external payable nonReentrant {
        require(!isClosed, "Piggy bank is closed");

        if (tokenAddress == address(0)) {

            require(msg.value > 0, "Amount must be greater than 0");
            require(msg.value == amount, "Sent value must match amount");
            balance += msg.value;
            emit Deposited(msg.sender, msg.value, block.timestamp);
        } else {

            require(amount > 0, "Amount must be greater than 0");
            require(msg.value == 0, "Cannot send Ether for token deposit");
            IERC20 token = IERC20(tokenAddress);
            require(token.transferFrom(msg.sender, address(this), amount), "Token transfer failed");
            balance += amount;
            emit Deposited(msg.sender, amount, block.timestamp);
        }
    }


    function withdraw(uint256 amount) external onlyOwner nonReentrant {
        require(!isClosed, "Piggy bank is closed");
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= balance, "Insufficient balance");

        uint256 feeAmount = 0;
        uint256 actualAmount = amount;


        if (block.timestamp < createdAt + lockPeriod) {
            feeAmount = (amount * EARLY_WITHDRAWAL_FEE) / FEE_DENOMINATOR;
            actualAmount = amount - feeAmount;


            if (tokenAddress == address(0)) {
                (bool success, ) = factory.call{value: feeAmount}("");
                require(success, "Failed to transfer fee to factory");
            } else {
                IERC20 token = IERC20(tokenAddress);
                require(token.transfer(factory, feeAmount), "Failed to transfer fee to factory");
            }

            emit EarlyWithdrawalFee(msg.sender, feeAmount, block.timestamp);
        }


        balance -= amount;


        if (tokenAddress == address(0)) {
            (bool success, ) = owner().call{value: actualAmount}("");
            require(success, "Failed to transfer Ether to owner");
        } else {
            IERC20 token = IERC20(tokenAddress);
            require(token.transfer(owner(), actualAmount), "Failed to transfer tokens to owner");
        }

        emit Withdrawn(msg.sender, actualAmount, block.timestamp);
    }


    function close() external onlyOwner nonReentrant {
        require(!isClosed, "Piggy bank is already closed");
        require(block.timestamp >= createdAt + lockPeriod, "Lock period not expired");

        isClosed = true;


        if (balance > 0) {
            uint256 remainingBalance = balance;
            balance = 0;

            if (tokenAddress == address(0)) {
                (bool success, ) = owner().call{value: remainingBalance}("");
                require(success, "Failed to transfer remaining Ether");
            } else {
                IERC20 token = IERC20(tokenAddress);
                require(token.transfer(owner(), remainingBalance), "Failed to transfer remaining tokens");
            }

            emit Withdrawn(msg.sender, remainingBalance, block.timestamp);
        }

        emit Closed(msg.sender, block.timestamp);
    }


    function emergencyClose() external {
        require(msg.sender == factory, "Only factory can emergency close");
        require(!isClosed, "Piggy bank is already closed");

        isClosed = true;


        if (balance > 0) {
            uint256 remainingBalance = balance;
            balance = 0;

            if (tokenAddress == address(0)) {
                (bool success, ) = factory.call{value: remainingBalance}("");
                require(success, "Failed to transfer remaining Ether to factory");
            } else {
                IERC20 token = IERC20(tokenAddress);
                require(token.transfer(factory, remainingBalance), "Failed to transfer remaining tokens to factory");
            }
        }

        emit Closed(owner(), block.timestamp);
    }


    function getTimeRemaining() external view returns (uint256) {
        if (block.timestamp >= createdAt + lockPeriod) {
            return 0;
        }
        return createdAt + lockPeriod - block.timestamp;
    }

    function isLockPeriodExpired() external view returns (bool) {
        return block.timestamp >= createdAt + lockPeriod;
    }

    function getPiggyBankDetails() external view returns (
        address owner_,
        address token,
        uint256 lockPeriod_,
        uint256 createdAt_,
        uint256 balance_,
        bool closed
    ) {
        return (
            owner(),
            tokenAddress,
            lockPeriod,
            createdAt,
            balance,
            isClosed
        );
    }


    function calculateEarlyWithdrawalFee(uint256 amount) external pure returns (uint256) {
        return (amount * EARLY_WITHDRAWAL_FEE) / FEE_DENOMINATOR;
    }


    function getBalance() external view returns (uint256) {
        return balance;
    }

    function getLockEndTime() external view returns (uint256) {
        return createdAt + lockPeriod;
    }

    function getEarlyWithdrawalFee(uint256 amount) external pure returns (uint256) {
        return (amount * EARLY_WITHDRAWAL_FEE) / FEE_DENOMINATOR;
    }


    receive() external payable {
        require(tokenAddress == address(0), "This piggy bank only accepts Ether");
        require(!isClosed, "Piggy bank is closed");

        balance += msg.value;
        emit Deposited(msg.sender, msg.value, block.timestamp);
    }
}

contracts/PiggyBankFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./PiggyBank.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";



contract PiggyBankFactory is Ownable {
   
    mapping(address => address[]) public userPiggyBanks;
    
   
    mapping(address => uint256) public userPiggyBankCount;
    
   
    address[] public allPiggyBanks;
    
    
    event PiggyBankCreated(address indexed user, address indexed piggyBank, uint256 lockPeriod);
    event PiggyBankRemoved(address indexed user, address indexed piggyBank);
    
    constructor() Ownable(msg.sender) {}
    
   
    function createPiggyBank(uint256 lockPeriod, address tokenAddress) external payable {
        require(lockPeriod > 0, "Lock period must be greater than 0");
        
     
        PiggyBank newPiggyBank = new PiggyBank(
            msg.sender,
            lockPeriod,
            tokenAddress,
            address(this)
        );
        
      
        if (tokenAddress == address(0)) {
            require(msg.value > 0, "Must send Ether when creating Ether piggy bank");
            (bool success, ) = address(newPiggyBank).call{value: msg.value}("");
            require(success, "Failed to transfer Ether to piggy bank");
        }
        
        
        userPiggyBanks[msg.sender].push(address(newPiggyBank));
        userPiggyBankCount[msg.sender]++;
        allPiggyBanks.push(address(newPiggyBank));
        
        emit PiggyBankCreated(msg.sender, address(newPiggyBank), lockPeriod);
    }
    
    
    function getUserPiggyBanks(address user) external view returns (address[] memory) {
        return userPiggyBanks[user];
    }
    
    
    function getUserPiggyBankCount(address user) external view returns (uint256) {
        return userPiggyBankCount[user];
    }
    
   
    function getAllPiggyBanks() external view returns (address[] memory) {
        return allPiggyBanks;
    }
    
   
    function getTotalPiggyBankCount() external view returns (uint256) {
        return allPiggyBanks.length;
    }
    
    
    function removePiggyBank(address piggyBankAddress) external {
        address[] storage userBanks = userPiggyBanks[msg.sender];
        bool found = false;
        
        for (uint256 i = 0; i < userBanks.length; i++) {
            if (userBanks[i] == piggyBankAddress) {
                found = true;
                
                PiggyBank piggyBank = PiggyBank(payable(piggyBankAddress));
                require(piggyBank.isClosed(), "Piggy bank must be closed to remove");
                
                // Remove from user's piggy banks
                userBanks[i] = userBanks[userBanks.length - 1];
                userBanks.pop();
                userPiggyBankCount[msg.sender]--;
                
                // Remove from all piggy banks
                for (uint256 j = 0; j < allPiggyBanks.length; j++) {
                    if (allPiggyBanks[j] == piggyBankAddress) {
                        allPiggyBanks[j] = allPiggyBanks[allPiggyBanks.length - 1];
                        allPiggyBanks.pop();
                        break;
                    }
                }
                
                emit PiggyBankRemoved(msg.sender, piggyBankAddress);
                break;
            }
        }
        
        require(found, "Piggy bank not found for user");
    }
   
    function emergencyClosePiggyBank(address piggyBankAddress) external onlyOwner {
        PiggyBank piggyBank = PiggyBank(payable(piggyBankAddress));
        piggyBank.emergencyClose();
    }
    
   
    function withdrawFees(address tokenAddress, uint256 amount) external onlyOwner {
        if (tokenAddress == address(0)) {
           
            require(address(this).balance >= amount, "Insufficient Ether balance");
            (bool success, ) = owner().call{value: amount}("");
            require(success, "Failed to transfer Ether");
        } else {
            
            IERC20 token = IERC20(tokenAddress);
            require(token.balanceOf(address(this)) >= amount, "Insufficient token balance");
            require(token.transfer(owner(), amount), "Failed to transfer tokens");
        }
    }
    
   
    function getFactoryBalance() external view returns (uint256) {
        return address(this).balance;
    }
    
    
    function getFactoryTokenBalance(address tokenAddress) external view returns (uint256) {
        if (tokenAddress == address(0)) {
            return address(this).balance;
        }
        return IERC20(tokenAddress).balanceOf(address(this));
    }
    

    function getTotalBalance() external view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < allPiggyBanks.length; i++) {
            total += PiggyBank(payable(allPiggyBanks[i])).balance();
        }
        return total;
    }
    
    function getUserBalance(address user) external view returns (uint256) {
        uint256 total = 0;
        address[] memory userBanks = userPiggyBanks[user];
        for (uint256 i = 0; i < userBanks.length; i++) {
            total += PiggyBank(payable(userBanks[i])).balance();
        }
        return total;
    }
    

    
    
    receive() external payable {}
}

